import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { EventserviceService } from '../serviceseventback/eventservice.service';
import { FeedbackService } from '../serviceseventback/feedback.service';
import { feedback } from '../../feedback';
import { User } from 'src/app/back-office/models/user';

@Component({
  selector: 'app-eventfeedbaks',
  templateUrl: './eventfeedbaks.component.html',
  styleUrls: ['./eventfeedbaks.component.css']
})
export class EventfeedbaksComponent {
  feedbacks: feedback[] = [];
  feedbackUsers: { [key: number]: User } = {}; 

  constructor(
    private route: ActivatedRoute,
    private feedbackservice: FeedbackService,
    private router: Router
  ) {}

  ngOnInit(): void {
    const eventId = Number(this.route.snapshot.paramMap.get('id'));

    this.feedbackservice.getfeedbacksevent(eventId).subscribe(
      data => {
        this.feedbacks = data;
        this.feedbacks.forEach(fb => {
          if (fb.feedbackId) {
            this.feedbackservice.getfeedbackuser(fb.feedbackId).subscribe(
              user => {
                this.feedbackUsers[fb.feedbackId!] = user;
              },
              error => console.error('Error fetching user for feedback:', error)
            );
          }
        });
      },
      error => console.error('Error fetching feedbacks', error)
    );
  }
}
<div class="feedback-container">
  <h2 class="section-title text-center">üìù Feedbacks for this Event</h2>

  <div *ngIf="feedbacks.length > 0; else noFeedback">
    <div *ngFor="let fb of feedbacks" class="feedback-card shadow-sm">
      <ng-container *ngIf="fb.feedbackId && feedbackUsers[fb.feedbackId] as user">
        <div class="user-info">
          <h4 class="user-name">üë§ {{ user.first_Name }} {{ user.last_Name }}</h4>
          <p class="user-id">üÜî User ID: {{ user.id_User }}</p>
        </div>
      </ng-container>

      <p class="feedback-rating"><strong>‚≠ê Rating:</strong> {{ fb.eventRating }}</p>
      <p class="feedback-comment"><strong>üó®Ô∏è Comment:</strong> {{ fb.comment }}</p>
    </div>
  </div>

  <ng-template #noFeedback>
    <p class="no-feedback-msg">No feedback available for this event.</p>
  </ng-template>
</div>

<div class="return-btn-wrapper">
  <button class="btn return-btn" routerLink="/admin/event">Return</button>
</div><br><br>
